import React, { useState } from 'react';
import { Link } from 'react-router-dom';
// import { useTranslation } from 'react-i18next';
import './Navbar.css';

function Navbar() {
  const [openDropdown, setOpenDropdown] = useState(null);
  const handleDropdown = (name) => setOpenDropdown(name);
  const closeDropdown = () => setOpenDropdown(null);
  return (
    <nav className="navbar" style={{ display: 'flex', justifyContent: 'center' , alignItems: 'center' }}>
      <div className="navbar-logo">
        <Link to="/home">Food Craft Institute Sumerpur</Link>
      </div>
      <ul className="navbar-links">
        <li><Link to="/home">Home</Link></li>
        <li className="dropdown" onMouseEnter={()=>handleDropdown('about')} onMouseLeave={closeDropdown}>
          <span>About Us ▾</span>
          {openDropdown==='about' && (
            <ul className="dropdown-menu">
              <li><Link to="/about">About Us</Link></li>
              <li><Link to="/mission-vision">Principal Message</Link></li>
              <li><Link to="/faculty">Why Us</Link></li>
              <li><Link to="/infrastructure">Overview & History</Link></li>
              <li><Link to="/placement">Vision & Objective</Link></li>
              <li><Link to="/testimonials">Our Staff</Link></li>
            </ul>
          )}
        </li>
        <li className="dropdown" onMouseEnter={()=>handleDropdown('student')} onMouseLeave={closeDropdown}>
          <span>Student Section ▾</span>
          {openDropdown==='student' && (
            <ul className="dropdown-menu">
              <li><Link to="/syllabus">Syllabus</Link></li>
              <li><Link to="/fee-structure">Fee Structure</Link></li>
              <li><Link to="/general-rules">General Rules</Link></li>
              <li><Link to="/anti-ragging">Anti Ragging Circular</Link></li>
            </ul>
          )}
        </li>
        <li className="dropdown" onMouseEnter={()=>handleDropdown('admissions')} onMouseLeave={closeDropdown}>
          <span>Admissions ▾</span>
          {openDropdown==='admissions' && (
            <ul className="dropdown-menu">
              <li><Link to="/fee-structure">Fee Structure</Link></li>
              <li><Link to="/admission-form">Admission Form</Link></li>
              <li><Link to="/medical-fitness-certificate">Medical Fitness Certificate</Link></li>
            </ul>
          )}
        </li>
        <li className="dropdown" onMouseEnter={()=>handleDropdown('courses')} onMouseLeave={closeDropdown}>
          <span>Courses ▾</span>
          {openDropdown==='courses' && (
            <ul className="dropdown-menu">
              <li><Link to="/courses">All Courses</Link></li>
              <li><Link to="/diploma/FoodProduction">Diploma in Food Production</Link></li>
              <li><Link to="/diploma/FoodBeverageService">Diploma in Food and Beverage Service</Link></li>
              <li><Link to="/diploma/FrontOffice">Diploma in Front Office</Link></li>
              <li><Link to="/courses/skill-development">Skill Development</Link></li>
            </ul>
          )}
        </li>
        <li><Link to="/contact">Contact</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;
